            "ko-KR": "Heal Over Time 인스턴스를 시작합니다. 이 Heal Over Time은 지정된 지속 시간이 경과하거나 스크립트에 의해 중지되기 전까지 유지됩니다. 이 Heal Over Time을 참조하려면 Last Heal Over Time ID 값을 사용하십시오.",
